import React from 'react';
import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import HeaderWithContext from './components/HeaderWithContext';
import ThemeToggle from './components/ThemeToggle';

function App() {
  return (
    <Router>
      <div className="App">
        <HeaderWithContext />
        <main className="container">
          <ThemeToggle />
          <h1>Welcome to Bitrader</h1>
          <p>Your application is now running successfully!</p>
        </main>
      </div>
      <Routes>
        {/* Add your routes here */}
        <Route path="/" element={<Home />} />
      </Routes>
    </Router>
  );
}

// Home component
function Home() {
  return (
    <div className="home-container">
      <h2>Home Page</h2>
      <p>This is the home page of your Bitrader application.</p>
    </div>
  );
}

export default App;
